import { Routes,Route } from 'react-router-dom'

import Landingpage from "./components/Landingpage";

function App() {
  return (
    <div>
      <Route>
        <Route path='/landingpage' element={<Landingpage/>}/>
        <Route path='/iandingpage' element={<Landingpage/>}/>
        <Route path='/randingpage' element={<Landingpage/>}/>
        <Route path='/pandingpage' element={<Landingpage/>}/>
        <Route path='/tandingpage' element={<Transport/>}/>
      </Route>

    </div>
  );
}

export default App;
